import React from "react";

function About() {
  return (
    <div className="page">
      <h1>О сайте</h1>
      <p>
        Добро пожаловать на новостной портал! Здесь вы найдете свежие статьи по темам технологий, бизнеса, науки и спорта.
      </p>
      <p>
        Проект создан в образовательных целях, чтобы показать, как можно собрать полноценный новостной сайт на React.
      </p>
    </div>
  );
}

export default About;
